import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-car-list',
  templateUrl: './car-list.page.html',
  styleUrls: ['./car-list.page.scss'],
})
export class CarListPage implements OnInit {

  cars: any = [
    {
    modelo: "Toyota",
    marca: "Corola",
    precio: 3100,
    descripcion: "coche seminuevo"
    }
  ]

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>car-list</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-item *ngFor = "let c of cars">
    <ion-label>
      <h1>{{c.modelo}}</h1>
      <p>{{c.marca}}</p>
      <p>{{c.precio}}</p>
      <p>{{c.descripcion}}</p>
    </ion-label>
  </ion-item>
</ion-content>
